import React, { useState, useEffect } from 'react';

export default function WCard() {
  const [weatherData, setWeatherData] = useState(null);
  const [updateTime, setUpdateTime] = useState(null);

  useEffect(() => {
    setUpdateTime(new Date());
  });

  return(
    <h1>{updateTime}</h1>
  );
}
